	(1, 'Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', 'Connaissances minimales en comptabilité requises. Le reste peu être appris sur le tas si vous voulez vous intégrer dans ce groupe. De la rigueur administrative est aussi de mise.', 'finances@assoc.ch', 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'userchat.link/join?v=ziodhjn6v0y45j', 'drive.link/open?f=3wj69szxdcvpc6z9gh1y2dtows6t7fd2ela2npzwldwql59wly2zwv8io6hwlj4683w', 'Travail une fois par mois pour les tâches répétitives', 1, 3, 55, '2020-05-22 08:18:38'),
	(2, 'Réflexion interne', 'Groupe pour réfléchir au fonctionnement interne.', 'Différentes tensions entre certains membres.', 'A partir du moment que vous avez constaté ou pu expérimenter des problèmes internes dans l\'organisation et la structure, vous êtes aptes à travailler dans ce groupe.', NULL, 'group_oivabk34kanwygt3vywoeplzf0lqox.jpg', 0, 'userchat.link/join?v=0kmfd21s6pg3hf', 'drive.link/open?f=alogrn8g7g61mgl3mgdxice8g374ut24ks44iffbh2pnm0mh0143a5vpc', '', 3, 3, 2, '2019-02-10 02:38:51'),
	(3, 'Coordination', 'Coordination générale. Fait des AG toutes les 2 semaines.', 'Besoin d\'un groupe contenant tout les membres.', 'quibus de veritate dissentiunt. De quibus cupio scire quid sentias. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Quam illa ardentis amores excitaret sui! Cur tandem? Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Nunc vero a primo quidem mirabiliter occulta natura est nec perspici nec cognosci potest. Sunt etiam turpitudines plurimae, quae, nisi honestas natura plurimum valeat, cur non cadant in sapientem non est facile defendere. Minime', NULL, 'group_ufgdaawfard697vev4q7biit5onz1v.jpg', 1, 'userchat.link/join?v=2dyn3k8sc0', 'drive.link/open?f=eciqd21h9zudj44cujb0qxblqjxtw50rtblw5obseu9gn82kz2vxbotqsd3ybtbmjk', '', 2, 3, 9, '2019-12-03 19:38:27'),
