	(12, 'Anniversaire', 'Organisation de la fête annuel de l\'anniversaire du collectif, qui consiste simplement en un apéro sur une soirée.', 'Moment de plaisir et de détente pour changer des périodes de l\'année intense en travail.', 'Quam illa ardentis amores excitaret sui! Cur tandem? Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Nunc vero a primo quidem mirabiliter occulta natura est nec perspici nec cognosci potest. Sunt etiam turpitudines plurimae, quae, nisi honestas natura plurimum valeat, cur non cadant in sapientem non est facile defendere. Minime vero probatur huic disciplinae, de qua loquor, aut iustitiam aut amicitiam propter utilitates adscisci aut probari. Ergo opifex plus sibi propon', 'anniversaire@assoc.ch', NULL, 1, 'userchat.link/join?v=5mkhpcc9h4', 'drive.link/open?f=thxgmjys8vyx115w1jc66fg8zceyuklgz733fd6q7km52r9cj13dlmyzhbktoqa0hwnca', 'Nouveau projet pour les 20 ans démarré.', 3, 1, 83, '2020-12-14 15:40:16'),
	(13, 'Bien-être', 'S\'occupe de gérer les conflits à l\'interne et de veiller au bien-être de chaque membre, via la boîte aux lettres.', '', 'excellens ad factorum pulchritudinem? Quasi ego id curem, quid ille aiat aut neget. \n\nMagno hic ingenio, sed res se tamen sic habet, ut nimis imperiosi philosophi sit vetare meminisse. Quae enim dici Latine posse non arbitrabar, ea dicta sunt a te verbis aptis nec minus plane quam dicuntur a Graecis. Si quicquam extra virtutem habeatur in bonis. Si ad corpus pertinentibus, rationes tuas te video compensare cum istis doloribus, non memoriam corpore perceptarum voluptatum; Quae quo sunt excelsio', 'bien-etre@assoc.ch', NULL, 1, 'userchat.link/join?v=e4jt2un8u1', 'drive.link/open?f=6cdddgn8qevelfsy9ra0hbz06iz6e3lxufvf6wqc6nj542fzpe91cp59nemm898ns1mkm3', 'Diverses conflits sont en cours d\'être géré mais cela prend du temps...', 0, 2, 48, '2019-07-21 13:55:20');
