	(1, 'josette27', 'JRD', 'Josette', 'Richard', 'userchat.link/user?t=mdmzx4d3np', 'josette.richard@assoc.ch', '8595231991', 'Dans le milieu associatif, depuis 10 ans déjà, je suis à dans assoc depuis 2015 et j\'aide plusieurs heures par semaines. La partie contact médias m\'intéresse beaucoup. Je suis photorgaphe de métier, mais aussi céramiste et je cultive un petit potager...', '$2y$10$SHz/smtgC5pyL4Rot9VfI.PG/pEE9Z2SQzKxat3/Wi1Yk9n6Q.7Z2', '2020-01-12 05:03:37', 0, 'Actuellement en vacances, je reviendrai le 15. En cas d\'urgence laissez moi un SMS et je vous rappelerai en soirée.', 4, 1, '2020-10-31 04:35:09'),
