	(3, 'megane44', 'MBN', 'Mégane', 'Blan', '', 'megane.blan@assoc.ch', '2917012526', 'Je suis une passionée de festival. J\'en vais 4 fois par mois. Je trouvais le festival de Assoc vraiment génial alors j\'ai voulu venir ajouter mon grain de sel et aider pour la communication. Je suis fan de musique et je joue du violon. Je consacre 5h par semaine à Assoc la plupart de l\'année, et tout mon temps quand il y a le festival...', '$2y$10$2TRZnoK.OrkT4JgGzVvbceh7xgr2ky2mZfg8GIjgy7QhPc.5S5G3S', '2020-12-23 22:34:07', 0, 'Encore quelques jours de repos avant de commencer à travailler à fond pour le festival. J\'aimerai que cette édition soit exceptionnelle!', 1, 1, '2021-01-03 18:58:22'),
