INSERT INTO `works` (`id`, `name`, `description`, `start`, `end`, `state`, `value`, `effort`, `visible`, `open`, `inbox`, `repetitive`, `need_help`, `creation_date`, `project_id`, `creator_id`, `responsible_id`) VALUES
	(1, 'Création sur crof.com', 'Création du compte sur la plafeforme de crowdfunding permettant de récolter les financements et d\'expliquer le but de ce financement participatif.', '2020-06-10 00:00:00', '2020-06-21 00:00:00', 2, 6, 8, 1, 0, 0, 0, 0, '2020-12-21 14:00:04', 2, 41, NULL),
	(2, 'Texte présentation', 'Ecrire le texte qui présente le projet et le collectif. Il faut donner un aperçu de ce qui s\'est déjà fait les années précédentes et ce qui est prévu pour cette année de spécial qui fait que le collectif lance ce crowdfunding.', '2020-06-11 00:00:00', '2020-06-21 00:00:00', 2, 8, 9, 1, 0, 0, 0, 1, '2020-12-21 09:15:09', 2, 91, NULL),
	(3, 'Vidéo présentation', 'Réaliser une vidéo pour présenter le festival. La vidéo sera affichée directement sur la première page sur crof.com quand les personnes intéressées cliqueront sur le lien.', '2020-06-15 00:00:00', '2020-06-30 00:00:00', 2, 6, 8, 0, 0, 0, 0, 0, '2020-12-23 03:19:48', 2, 44, 97),
	(4, 'Brainstorming de la faisabilité du projet', 'La gestion d\'une campagne crowdfunding demandant des compétences particulières et une énergie importante, le GT Festival doit discuter de son déroulement et des moyens à dispositions (notamment la collaboration avec d\'autres GTs).', '2020-06-02 00:00:00', '2020-06-08 00:00:00', 4, 8, 3, 1, 0, 0, 0, 0, '2020-12-17 17:41:46', 2, 15, NULL),
	(5, 'Coordination + partage du travail entre les 4 GTs', '4 GTs qui travaillent en parallèle sur le même projet, on a vraiment besoin d\'une bonne coordination et un partage du travail clairement défini.', '2020-06-08 00:00:00', '2020-06-13 00:00:00', 4, 9, 3, 1, 0, 0, 0, 0, '2020-12-11 22:09:27', 2, 100, NULL),
	(6, 'Comptabilité finale', 'Décompte et validations des dons', '2020-07-15 00:00:00', '2020-07-25 00:00:00', 1, 9, 6, 1, 0, 0, 0, 0, '2020-12-19 19:49:59', 2, 87, 50),
	(7, 'Gestion des demandes par email', 'Gestion des demandes et questions par email à propos du crowdfunding. Actuellement en pause parce que pas le temps avec les autres travaux.', '2020-06-10 00:00:00', '2020-07-30 00:00:00', 3, 5, 5, 1, 0, 0, 0, 0, '2020-12-24 11:00:27', 2, 95, NULL),
	(8, 'Résoudre les questions juridiques', 'Les questions juridiques quand au possible remboursement après dons doivent être résolues afin de limiter les problèmes par la suite.', '2020-06-08 00:00:00', '2020-06-10 00:00:00', 4, 3, 4, 1, 0, 0, 0, 0, '2020-12-25 16:41:56', 2, 24, NULL),
	(9, 'Communication sur la campagne', 'Envoi à travers la newsletter, les réseaux sociaux et autres canaux de communications externes, un message pour appeler les personnes qui nous suivent à participer au crowdfunding, en joignant à ce message un lien vers crof.com', '2020-07-01 00:00:00', '2020-07-03 00:00:00', 1, 10, 5, 1, 0, 0, 0, 0, '2020-12-22 23:55:25', 2, 38, NULL),
